import React, { Components } from 'react';
import { connect } from 'react-redux';
import { } from '../../redux/action-creators';
import { BrowserRouter, Router, Switch } from 'react-router-dom';
import Home from '../../components/Home';
import createUser from '../../components/CreateUser';
import editUser from '../../components/EditUser';

class App extends Components {
  constructor(props) {
    super(props);
    this.state = { searchText: ''};
  }

  render() {
    const { users } = this.props.users;
    return (
      <BrowserRouter>
        <div>

          <Switch>
            <Router exact = {true} path = '/' component = {Home} />
            <Router path = '/users' component = {Home} />
            <Router path = '/users/:user_id' component = {createUser} />
            <Router path = '/' component = {Home} />
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    filter:state.filter,
    createUsers:state.createUser,
    updateUsers:state.updateUsers,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {

  };
};

export default connect(mapStateToProps, mapDispatchToProps)(App);
